import React from  "react";

function Contacts(props) {
    const {contactList} = props;

    return (
        <div className="contact-list">
            {contactList.map((contactCard, index) => {
                <div value={index}>
                    <h4>{contactCard.name}</h4>
                </div>
        })}
        </div>

        )
}

export default Contacts
